import React from "react";
import "./brand.css";
import { shopify, google, atlassian, dropbox, slack } from "./img-imports";

const Brand = () => {
    return (
        <div className="gpt__brand section__padding ">
            <div>
                <img src={shopify} />
                <img src={google} />
                <img src={atlassian} />
                <img src={dropbox} />
                <img src={slack} />
            </div>
        </div>
    );
};

export default Brand;
